import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import App from './App';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: { main: '#FFC107' },
    secondary: { main: '#FF9800' },
    background: {
      default: '#2B2B2B', // slightly gray, not super dark
      paper: '#262626',
    },
    text: {
      primary: '#FFFFFF',
      secondary: '#D6D6D6',
    },
  },
  typography: { fontFamily: 'Roboto, Arial, sans-serif' },
  components: {
    MuiAppBar: {
      styleOverrides: {
        root: {
          backgroundColor: '#212121',
        },
      },
    },
    MuiButton: {
      styleOverrides: {
        containedPrimary: {
          background: 'linear-gradient(90deg, #FFC107 0%, #FF9800 100%)',
          color: '#fff',
          '&:hover': {
            background: 'linear-gradient(90deg, #FFB300 0%, #F57C00 100%)',
          },
        },
      },
    },
    MuiPaper: {
      styleOverrides: {
        root: {
          backgroundColor: '#262626',
        },
      },
    },
    MuiCard: {
      styleOverrides: {
        root: {
          backgroundColor: '#2A2A2A',
        },
      },
    },
    MuiOutlinedInput: {
      styleOverrides: {
        root: {
          backgroundColor: '#333333',
          borderRadius: 8,
        },
        input: {
          color: '#FFFFFF',
          '::placeholder': {
            color: '#BDBDBD',
            opacity: 1,
          },
        },
        notchedOutline: {
          borderColor: '#444',
        },
      },
    },
    MuiInputLabel: {
      styleOverrides: {
        root: {
          color: '#E0E0E0',
        },
      },
    },
    MuiInputAdornment: {
      styleOverrides: {
        root: { color: '#E0E0E0' },
      },
    },
  },
});

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <App />
      </ThemeProvider>
    </BrowserRouter>
  </React.StrictMode>
);
